import React from "react";

function Map({ lat, lng }) {
  const location = `${lat},${lng}`;
  const mapUrl = `https://www.google.com/maps/embed/v1/view?key=${process.env.REACT_APP_GOOGLE_MAPS_API_KEY}&center=${location}&zoom=12&maptype=roadmap`;
  const streetUrl = `https://www.google.com/maps/embed/v1/streetview?key=${process.env.REACT_APP_GOOGLE_MAPS_API_KEY}&location=${location}&heading=210&pitch=10&fov=80`;

  return (
    <div className="space-y-6">
      <div>
        <h2 className="text-xl font-semibold text-gray-800 dark:text-gray-200 mb-2">Map View</h2>
        <iframe
          title="Map View"
          width="100%"
          height="300"
          loading="lazy"
          className="rounded-lg shadow"
          src={mapUrl}
        />
      </div>

      <div>
        <h2 className="text-xl font-semibold text-gray-800 dark:text-gray-200 mb-2">Street View</h2>
        <iframe
          title="Street View"
          width="100%"
          height="300"
          loading="lazy"
          className="rounded-lg shadow"
          src={streetUrl}
        />
      </div>
    </div>
  );
}

export default Map;
